import {
  UPDATE_SCREEN_HEIGHT,
  UPDATE_DARKMODE,
  UPDATE_DARKMODETOGGLE,
} from "./global_ActionTypes";

const initialStateButtons = {
  shade: "#cccccc",
  shade2: "#ffffff",
  shade2num: "1.1",
  shade2nump: "1.8",
  logoimage: SuperstarzIconDark,
  secondarymaincolor: "#ccccccff",
  maincolor: "#ccccccff",
  shade2nump22: "5.5",
  PaperStyle: "linear-gradient(0deg, #282c34, #282c36, #191919 )",
  littleTextColor: "#ccccccff",
  ////For example const initialState = { person: null as Person };
};

type MyButtonsReducerDark = typeof initialStateButtons;
export const ButtonsReducerDark = (
  state = initialStateButtons,
  action: any
): MyButtonsReducerDark => {
  switch (action.type) {
    default:
      return state;
  }
};

const initialState = {
  screenHeight: 0,
  darkmode: false,
  ////For example const initialState = { person: null as Person };
};

type MyGlobalReducer = typeof initialState;
export const GlobalReducer = (
  state = initialState,
  action: any
): MyGlobalReducer => {
  switch (action.type) {
    case UPDATE_SCREEN_HEIGHT:
      return { ...state, screenHeight: action.payload };
    case UPDATE_DARKMODE:
      return { ...state, darkmode: action.payload };
    case UPDATE_DARKMODETOGGLE:
      return { ...state, darkmode: !state.darkmode };
    default:
      return state;
  }
};
